import React from "react";

function Index() {
  return (
    <div className="flex w-full px-20 bg-smokegrey text-sm justify-center ">
      <p className="flex ">
        By accessing using this website, you acknoledge that you have read and
        understand our Cookie Police, Privacy Police, and our Terms of service
      </p>
      <button className="bg-blue">Got it</button>
    </div>
  );
}

export default Index;
